<script>
    function openToOrder(OrderID){
        $('#GoodsWindow').empty();
        var text = '';
        $.ajax({
            type: 'POST',
            data: {
                "do": "getGoodsByOrder",
                "OrderID": OrderID
            },
            success: function(data){
                var order = JSON.parse(data);
                if(order){
                    text = '<table width="100%" id="listAsideCarts" cellspacing="0">';
                    $(order).each(function(i,val){
                        text = text + '<tr><td width="40px" align="center" class="tdborder first">'+(i+1)+'</td>' +
                        '<td class="tdborder">'+val.name+'</td>' +
                        '<td class="tdborder">'+val.count+'</td>' +
                        '<td class="tdborder">'+(val.count*val.price)+' грн.</td></tr>';
                    });
                    text = text + '</table>';
                }
                $('#GoodsWindow').append(text);
                $('#GoodsWindow').modal().open();
            }
        });
    }
    function printNakladna(OrderID){
        var params = "menubar=yes,location=yes,resizable=yes,scrollbars=yes,status=yes";
        window.open(window.location.origin+"/admin/printnakladnamagazin/"+OrderID, "_blank", params);    }
    function changeOptRozniza(){
        $.ajax({
            type: 'POST',
            data: {
                "do": "changeOptRozniza"
            },
            success: function(data){
                $('#setAsideCart').submit();
            }
        });
    }
</script>
